import React from "react";
import { Button, Modal, Form } from "semantic-ui-react";
import "semantic-ui-css/semantic.min.css";

const AddCustomer = (props) => {
  const { open } = props;
  return (
    <Modal size={small} centered={true} open={open}>
      <Modal.Header>Create Customer</Modal.Header>
      <Modal.Content>
        <Form>
          <Form.Field>
            <label>Name</label>
            <input placeholder="Customer Name" />
          </Form.Field>
          <Form.Field>
            <label>Address</label>
            <input placeholder="Customer Address" />
          </Form.Field>
        </Form>
      </Modal.Content>
      <Modal.Actions>
        <Button color="black">Cancel</Button>
        <Button color="green" labelPosition="right" icon="checkmark">
          Create
        </Button>
      </Modal.Actions>
    </Modal>
  );
};

export default AddCustomer;
